__ht__function(data, gv, cache) {cache = _i.innerRecoveredDataCache(data, cache, false, 'fan', '扇叶');
if(!data._i_once){
    data._i_once = true;
    //240819，放到这里单独定时器来做旋转
    i.md(data,gv,cache,{
        'a:fan.switchValue': e=>{
            if(e.newValue){
                data._i_timer = setInterval(()=>{
                    let num = data.ca('fan.rotation');
                    if(num === undefined) num = 0;
                    //240819，实测发现fan.speed在1~10最合理！！
                    let speedtmp = data.ca('fan.speed');
                    data.ca('fan.rotation', num - speedtmp);
                },20); //240819，固定20ms刷新
            }else{
                clearInterval(data._i_timer);
            }
        }
    },['a:fan.switchValue']);
}}
